import React from 'react';
import SelectionForm from '../Componets/SelectionForm/SelectionForm'


function FormPage({ kayaks, route, value, kayaksInStock, setViewing, setFormView, setFormData }) {


    
    
    
    
    return (
        <div>
            <SelectionForm  kayaks={kayaks} route={route} value={value} kayaksInStock={kayaksInStock} setViewing={setViewing} setFormView={setFormView} setFormData={setFormData} />
        </div>
    )
}

export default FormPage;
